// Dashboard.js
import React from 'react';

const Dashboard = () => {
  return (
    <div>
      <h2>Data Dashboard</h2>
      <div style={styles.container}>
        <div style={styles.graphSection}>
          {/* Placeholder for the first graph */}
          <h3>Graph 1</h3>
          <div style={styles.graph}></div>
        </div>
        <div style={styles.graphSection}>
          {/* Placeholder for the second graph */}
          <h3>Graph 2</h3>
          <div style={styles.graph}></div>
        </div>
        <div style={styles.graphSection}>
          {/* Placeholder for the third graph */}
          <h3>Graph 3</h3>
          <div style={styles.graph}></div>
        </div>
      </div>
      <div style={styles.metricsContainer}>
        <div style={styles.metricBox}>
          <h3>Metric 1</h3>
          <div style={styles.metricSlicer}></div>
        </div>
        <div style={styles.metricBox}>
          <h3>Metric 2</h3>
          <div style={styles.metricSlicer}></div>
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    display: 'flex',
    justifyContent: 'space-between',
    marginTop: '20px',
  },
  graphSection: {
    flex: 1,
    padding: '20px',
    border: '1px solid #ccc',
    borderRadius: '4px',
    marginBottom: '20px',
  },
  graph: {
    width: '100%',
    height: '300px',
    backgroundColor: '#f0f0f0',
  },
  metricsContainer: {
    display: 'flex',
    justifyContent: 'space-between',
  },
  metricBox: {
    flex: 1,
    padding: '20px',
    border: '1px solid #ccc',
    borderRadius: '4px',
    marginBottom: '20px',
  },
  metricSlicer: {
    width: '100%',
    height: '100px',
    backgroundColor: '#e0e0e0',
  },
};

export default Dashboard;
